03-2c857176ffd0\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"keywords\":[{\"main\":\"Les ressources\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":14.161220043572984,\"y\":4.29436559139785,\"width\":39.97821350762527,\"height\":10.75268817204301,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#ffffff\\\"><span style=\\\"font-size:1.75em\\\">Les ressources</span></span></p>\\n\"},\"subContentId\":\"74d79464-c8e9-4fb5-bbc7-1f6c986ab825\",\"metadata\":{\"contentType\":\"Texte\",\"license\":\"U\",\"title\":\"Titre\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Titre\"}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":4.357298474945534,\"y\":23.65591397849462,\"width\":68.95424836601308,\"height\":75.26881720430107,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Certains arguments sont spéciaux et jouent des rôles particuliers :</p>\\n\\n<p> </p>\\n\\n<ul>\\n\\t<li><strong>depends_on</strong> : définit des dépendances avec d'autres ressources</li>\\n\\t<li><strong>count</strong> : définit le nombre d'instances souhaitées de la ressource</li>\\n\\t<li><strong>provider</strong> : permet de préciser quel fournisseur utiliser si celui-ci est différent de celui par défaut</li>\\n\\t<li><strong>lifecycle</strong> : personnalise le cycle de vie de la ressource</li>\\n\\t<li><strong>provisioner</strong> et <strong>connection</strong> : actions complémentaires à réaliser après la création de la ressource</li>\\n\\t<li><strong>timeouts</strong> : timeout lors de la création et de la destruction de la ressource</li>\\n</ul>\\n\"},\"metadata\":{\"contentType\":\"Texte\",\"license\":\"U\",\"title\":\"Arguments spéciaux des ressou
